@testset "4.1.2.1 (a+b sin)^m (c+d sin)^n" begin
    @variables A, B, a, b, c, d, e, f, m, n, p, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(d*sin(e+f*x))^n*(a+b*sin(e+f*x))^m=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*sin(e+f*x))^n*(a+a*sin(e+f*x))^m=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sin(e+f*x)^n*(a+a*sin(e+f*x))^m=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sin(e + f*x)^3*(a + a*sin(e + f*x))^2, x, 9, (3*a^2*x)/4 - (2*a^2*cos(e + f*x))/f + (a^2*cos(e + f*x)^3)/f - (a^2*cos(e + f*x)^5)/(5*f) - (3*a^2*cos(e + f*x)*sin(e + f*x))/(4*f) - (a^2*cos(e + f*x)*sin(e + f*x)^3)/(2*f)]


    @test_int [sin(e + f*x)^3*(a + a*sin(e + f*x))^3, x, 13, (23*a^3*x)/16 - (4*a^3*cos(e + f*x))/f + (7*a^3*cos(e + f*x)^3)/(3*f) - (3*a^3*cos(e + f*x)^5)/(5*f) - (23*a^3*cos(e + f*x)*sin(e + f*x))/(16*f) - (23*a^3*cos(e + f*x)*sin(e + f*x)^3)/(24*f) - (a^3*cos(e + f*x)*sin(e + f*x)^5)/(6*f)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [sin(x)^4/(a + a*sin(x)), x, 6, -((3*x)/(2*a)) - (4*cos(x))/a + (4*cos(x)^3)/(3*a) + (3*cos(x)*sin(x))/(2*a) + (cos(x)*sin(x)^3)/(a + a*sin(x))]
    @test_int [sin(x)^3/(a + a*sin(x)), x, 2, (3*x)/(2*a) + (2*cos(x))/a - (3*cos(x)*sin(x))/(2*a) + (cos(x)*sin(x)^2)/(a + a*sin(x))]
    @test_int [sin(x)^2/(a + a*sin(x)), x, 4, -(x/a) - cos(x)/a - cos(x)/(a*(1 + sin(x)))]
    @test_int [sin(x)^1/(a + a*sin(x)), x, 2, x/a + cos(x)/(a + a*sin(x))]
    @test_int [sin(x)^0/(a + a*sin(x)), x, 1, -(cos(x)/(a + a*sin(x)))]
    @test_int [csc(x)^1/(a + a*sin(x)), x, 3, -(atanh(cos(x))/a) + cos(x)/(a + a*sin(x))]
    @test_int [csc(x)^2/(a + a*sin(x)), x, 5, atanh(cos(x))/a - (2*cot(x))/a + cot(x)/(a + a*sin(x))]
    @test_int [csc(x)^3/(a + a*sin(x)), x, 6, -((3*atanh(cos(x)))/(2*a)) + (2*cot(x))/a - (3*cot(x)*csc(x))/(2*a) + (cot(x)*csc(x))/(a + a*sin(x))]
    @test_int [csc(x)^4/(a + a*sin(x)), x, 6, (3*atanh(cos(x)))/(2*a) - (4*cot(x))/a - (4*cot(x)^3)/(3*a) + (3*cot(x)*csc(x))/(2*a) + (cot(x)*csc(x)^2)/(a + a*sin(x))]


    @test_int [sin(x)^4/(a + a*sin(x))^2, x, 3, (7*x)/(2*a^2) + (16*cos(x))/(3*a^2) - (7*cos(x)*sin(x))/(2*a^2) + (8*cos(x)*sin(x)^2)/(3*a^2*(1 + sin(x))) + (cos(x)*sin(x)^3)/(3*(a + a*sin(x))^2)]
    @test_int [sin(x)^3/(a + a*sin(x))^2, x, 6, -((2*x)/a^2) - (4*cos(x))/(3*a^2) - (2*cos(x))/(a^2*(1 + sin(x))) + (cos(x)*sin(x)^2)/(3*(a + a*sin(x))^2)]
    @test_int [sin(x)^2/(a + a*sin(x))^2, x, 3, x/a^2 + (5*cos(x))/(3*a^2*(1 + sin(x))) - cos(x)/(3*(a + a*sin(x))^2)]
    @test_int [sin(x)^1/(a + a*sin(x))^2, x, 2, cos(x)/(3*(a + a*sin(x))^2) - (2*cos(x))/(3*(a^2 + a^2*sin(x)))]
    @test_int [sin(x)^0/(a + a*sin(x))^2, x, 2, -(cos(x)/(3*(a + a*sin(x))^2)) - cos(x)/(3*(a^2 + a^2*sin(x)))]
    @test_int [csc(x)^1/(a + a*sin(x))^2, x, 4, -(atanh(cos(x))/a^2) + (4*cos(x))/(3*a^2*(1 + sin(x))) + cos(x)/(3*(a + a*sin(x))^2)]
    @test_int [csc(x)^2/(a + a*sin(x))^2, x, 6, (2*atanh(cos(x)))/a^2 - (10*cot(x))/(3*a^2) + (2*cot(x))/(a^2*(1 + sin(x))) + cot(x)/(3*(a + a*sin(x))^2)]
    @test_int [csc(x)^3/(a + a*sin(x))^2, x, 7, -((7*atanh(cos(x)))/(2*a^2)) + (16*cot(x))/(3*a^2) - (7*cot(x)*csc(x))/(2*a^2) + (8*cot(x)*csc(x))/(3*a^2*(1 + sin(x))) + (cot(x)*csc(x))/(3*(a + a*sin(x))^2)]
    @test_int [csc(x)^4/(a + a*sin(x))^2, x, 7, (5*atanh(cos(x)))/a^2 - (4*cot(x))/a^2 - cot(x)^3/(3*a^2) + (cot(x)*csc(x))/a^2 - cos(x)/(3*a^2*(1 + sin(x))^2) - (13*cos(x))/(3*a^2*(1 + sin(x))), (5*atanh(cos(x)))/a^2 - (12*cot(x))/a^2 - (4*cot(x)^3)/a^2 + (5*cot(x)*csc(x))/a^2 + (10*cot(x)*csc(x)^2)/(3*a^2*(1 + sin(x))) + (cot(x)*csc(x)^2)/(3*(a + a*sin(x))^2)]


    @test_int [sin(x)^6/(a + a*sin(x))^3, x, 8, -((23*x)/(2*a^3)) - (136*cos(x))/(5*a^3) + (136*cos(x)^3)/(15*a^3) + (23*cos(x)*sin(x))/(2*a^3) + (cos(x)*sin(x)^5)/(5*(a + a*sin(x))^3) + (13*cos(x)*sin(x)^4)/(15*a*(a + a*sin(x))^2) + (23*cos(x)*sin(x)^3)/(3*(a^3 + a^3*sin(x)))]
    @test_int [sin(x)^5/(a + a*sin(x))^3, x, 4, (13*x)/(2*a^3) + (152*cos(x))/(15*a^3) - (13*cos(x)*sin(x))/(2*a^3) + (cos(x)*sin(x)^4)/(5*(a + a*sin(x))^3) + (11*cos(x)*sin(x)^3)/(15*a*(a + a*sin(x))^2) + (76*cos(x)*sin(x)^2)/(15*(a^3 + a^3*sin(x)))]
    @test_int [sin(x)^4/(a + a*sin(x))^3, x, 7, -((3*x)/a^3) - (9*cos(x))/(5*a^3) + (cos(x)*sin(x)^3)/(5*(a + a*sin(x))^3) + (3*cos(x)*sin(x)^2)/(5*a*(a + a*sin(x))^2) - (3*cos(x))/(a^3 + a^3*sin(x))]
    @test_int [sin(x)^3/(a + a*sin(x))^3, x, 5, x/a^3 + (cos(x)*sin(x)^2)/(5*(a + a*sin(x))^3) - (7*cos(x))/(15*a*(a + a*sin(x))^2) + (29*cos(x))/(15*(a^3 + a^3*sin(x)))]
    @test_int [sin(x)^2/(a + a*sin(x))^3, x, 3, -(cos(x)/(5*(a + a*sin(x))^3)) + (8*cos(x))/(15*a*(a + a*sin(x))^2) - (7*cos(x))/(15*(a^3 + a^3*sin(x)))]
    @test_int [sin(x)^1/(a + a*sin(x))^3, x, 3, cos(x)/(5*(a + a*sin(x))^3) - cos(x)/(5*a*(a + a*sin(x))^2) - cos(x)/(5*(a^3 + a^3*sin(x)))]
    @test_int [sin(x)^0/(a + a*sin(x))^3, x, 3, -(cos(x)/(5*(a + a*sin(x))^3)) - (2*cos(x))/(15*a*(a + a*sin(x))^2) - (2*cos(x))/(15*(a^3 + a^3*sin(x)))]
    @test_int [csc(x)^1/(a + a*sin(x))^3, x, 5, -(atanh(cos(x))/a^3) + cos(x)/(5*(a + a*sin(x))^3) + (7*cos(x))/(15*a*(a + a*sin(x))^2) + (22*cos(x))/(15*(a^3 + a^3*sin(x)))]
    @test_int [csc(x)^2/(a + a*sin(x))^3, x, 7, (3*atanh(cos(x)))/a^3 - (24*cot(x))/(5*a^3) + cot(x)/(5*(a + a*sin(x))^3) + (3*cot(x))/(5*a*(a + a*sin(x))^2) + (3*cot(x))/(a^3 + a^3*sin(x))]
    @test_int [csc(x)^3/(a + a*sin(x))^3, x, 8, -((13*atanh(cos(x)))/(2*a^3)) + (152*cot(x))/(15*a^3) - (13*cot(x)*csc(x))/(2*a^3) + (cot(x)*csc(x))/(5*(a + a*sin(x))^3) + (11*cot(x)*csc(x))/(15*a*(a + a*sin(x))^2) + (76*cot(x)*csc(x))/(15*(a^3 + a^3*sin(x)))]
    @test_int [csc(x)^4/(a + a*sin(x))^3, x, 8, (23*atanh(cos(x)))/(2*a^3) - (136*cot(x))/(5*a^3) - (136*cot(x)^3)/(15*a^3) + (23*cot(x)*csc(x))/(2*a^3) + (cot(x)*csc(x)^2)/(5*(a + a*sin(x))^3) + (13*cot(x)*csc(x)^2)/(15*a*(a + a*sin(x))^2) + (23*cot(x)*csc(x)^2)/(3*(a^3 + a^3*sin(x)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sin(e+f*x)^n*(a+a*sin(e+f*x))^(m/2)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sin(c + d*x)^4*sqrt(a + a*sin(c + d*x)), x, 5, -((32*a*cos(c + d*x))/(45*d*sqrt(a + a*sin(c + d*x)))) - (16*a*cos(c + d*x)*sin(c + d*x)^3)/(63*d*sqrt(a + a*sin(c + d*x))) - (2*a*cos(c + d*x)*sin(c + d*x)^4)/(9*d*sqrt(a + a*sin(c + d*x))) + (64*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(315*d) - (32*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(105*a*d)]
    @test_int [sin(c + d*x)^3*sqrt(a + a*sin(c + d*x)), x, 4, -((4*a*cos(c + d*x))/(5*d*sqrt(a + a*sin(c + d*x)))) - (2*a*cos(c + d*x)*sin(c + d*x)^3)/(7*d*sqrt(a + a*sin(c + d*x))) + (8*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(35*d) - (12*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(35*a*d)]
    @test_int [sin(c + d*x)^2*sqrt(a + a*sin(c + d*x)), x, 3, -((14*a*cos(c + d*x))/(15*d*sqrt(a + a*sin(c + d*x)))) + (4*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(15*d) - (2*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(5*a*d)]
    @test_int [sin(c + d*x)^1*sqrt(a + a*sin(c + d*x)), x, 2, -((2*a*cos(c + d*x))/(3*d*sqrt(a + a*sin(c + d*x)))) - (2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(3*d)]
    @test_int [sin(c + d*x)^0*sqrt(a + a*sin(c + d*x)), x, 1, -((2*a*cos(c + d*x))/(d*sqrt(a + a*sin(c + d*x))))]
    @test_int [csc(c + d*x)^1*sqrt(a + a*sin(c + d*x)), x, 2, -((2*sqrt(a)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d)]
    @test_int [csc(c + d*x)^2*sqrt(a + a*sin(c + d*x)), x, 3, -((sqrt(a)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d) - (a*cot(c + d*x))/(d*sqrt(a + a*sin(c + d*x)))]
    @test_int [csc(c + d*x)^3*sqrt(a + a*sin(c + d*x)), x, 4, -((3*sqrt(a)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(4*d)) - (3*a*cot(c + d*x))/(4*d*sqrt(a + a*sin(c + d*x))) - (a*cot(c + d*x)*csc(c + d*x))/(2*d*sqrt(a + a*sin(c + d*x)))]
    @test_int [csc(c + d*x)^4*sqrt(a + a*sin(c + d*x)), x, 5, -((5*sqrt(a)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(8*d)) - (5*a*cot(c + d*x))/(8*d*sqrt(a + a*sin(c + d*x))) - (5*a*cot(c + d*x)*csc(c + d*x))/(12*d*sqrt(a + a*sin(c + d*x))) - (a*cot(c + d*x)*csc(c + d*x)^2)/(3*d*sqrt(a + a*sin(c + d*x)))]

    @test_int [csc(c + d*x)^1*sqrt(a - a*sin(c + d*x)), x, 2, -2*(sqrt(a)/d)*atanh(sqrt(a)*(cos(c + d*x)/sqrt(a - a*sin(c + d*x))))]

    @test_int [csc(c + d*x)^1*sqrt(-a + a*sin(c + d*x)), x, 2, 2*(sqrt(a)/d)*atan(sqrt(a)*(cos(c + d*x)/sqrt(-a + a*sin(c + d*x))))]

    @test_int [csc(c + d*x)^1*sqrt(-a - a*sin(c + d*x)), x, 2, 2*(sqrt(a)/d)*atan(sqrt(a)*(cos(c + d*x)/sqrt(-a - a*sin(c + d*x))))]


    @test_int [sin(c + d*x)^3*(a + a*sin(c + d*x))^(3/2), x, 6, -((68*a^2*cos(c + d*x))/(45*d*sqrt(a + a*sin(c + d*x)))) - (34*a^2*cos(c + d*x)*sin(c + d*x)^3)/(63*d*sqrt(a + a*sin(c + d*x))) - (2*a^2*cos(c + d*x)*sin(c + d*x)^4)/(9*d*sqrt(a + a*sin(c + d*x))) + (136*a*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(315*d) - (68*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(105*d)]
    @test_int [sin(c + d*x)^2*(a + a*sin(c + d*x))^(3/2), x, 4, -((152*a^2*cos(c + d*x))/(105*d*sqrt(a + a*sin(c + d*x)))) - (38*a*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(105*d) + (4*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(35*d) - (2*cos(c + d*x)*(a + a*sin(c + d*x))^(5/2))/(7*a*d)]
    @test_int [sin(c + d*x)^1*(a + a*sin(c + d*x))^(3/2), x, 3, -((8*a^2*cos(c + d*x))/(5*d*sqrt(a + a*sin(c + d*x)))) - (2*a*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(5*d) - (2*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(5*d)]
    @test_int [sin(c + d*x)^0*(a + a*sin(c + d*x))^(3/2), x, 2, -((8*a^2*cos(c + d*x))/(3*d*sqrt(a + a*sin(c + d*x)))) - (2*a*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(3*d)]
    @test_int [csc(c + d*x)^1*(a + a*sin(c + d*x))^(3/2), x, 4, -((2*a^(3/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d) - (2*a^2*cos(c + d*x))/(d*sqrt(a + a*sin(c + d*x)))]
    @test_int [csc(c + d*x)^2*(a + a*sin(c + d*x))^(3/2), x, 4, -((3*a^(3/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d) - (a^2*cot(c + d*x))/(d*sqrt(a + a*sin(c + d*x)))]
    @test_int [csc(c + d*x)^3*(a + a*sin(c + d*x))^(3/2), x, 5, -((7*a^(3/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(4*d)) - (7*a^2*cot(c + d*x))/(4*d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*csc(c + d*x))/(2*d*sqrt(a + a*sin(c + d*x)))]
    @test_int [csc(c + d*x)^4*(a + a*sin(c + d*x))^(3/2), x, 6, -((11*a^(3/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(8*d)) - (11*a^2*cot(c + d*x))/(8*d*sqrt(a + a*sin(c + d*x))) - (11*a^2*cot(c + d*x)*csc(c + d*x))/(12*d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*csc(c + d*x)^2)/(3*d*sqrt(a + a*sin(c + d*x)))]


    @test_int [sin(c + d*x)^3*(a + a*sin(c + d*x))^(5/2), x, 6, -((284*a^3*cos(c + d*x))/(99*d*sqrt(a + a*sin(c + d*x)))) - (710*a^3*cos(c + d*x)*sin(c + d*x)^3)/(693*d*sqrt(a + a*sin(c + d*x))) - (46*a^3*cos(c + d*x)*sin(c + d*x)^4)/(99*d*sqrt(a + a*sin(c + d*x))) + (568*a^2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(693*d) - (2*a^2*cos(c + d*x)*sin(c + d*x)^4*sqrt(a + a*sin(c + d*x)))/(11*d) - (284*a*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(231*d)]
    @test_int [sin(c + d*x)^2*(a + a*sin(c + d*x))^(5/2), x, 5, -((832*a^3*cos(c + d*x))/(315*d*sqrt(a + a*sin(c + d*x)))) - (208*a^2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(315*d) - (26*a*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(105*d) + (4*cos(c + d*x)*(a + a*sin(c + d*x))^(5/2))/(63*d) - (2*cos(c + d*x)*(a + a*sin(c + d*x))^(7/2))/(9*a*d)]
    @test_int [sin(c + d*x)^1*(a + a*sin(c + d*x))^(5/2), x, 4, -((64*a^3*cos(c + d*x))/(21*d*sqrt(a + a*sin(c + d*x)))) - (16*a^2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(21*d) - (2*a*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(7*d) - (2*cos(c + d*x)*(a + a*sin(c + d*x))^(5/2))/(7*d)]
    @test_int [sin(c + d*x)^0*(a + a*sin(c + d*x))^(5/2), x, 3, -((64*a^3*cos(c + d*x))/(15*d*sqrt(a + a*sin(c + d*x)))) - (16*a^2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(15*d) - (2*a*cos(c + d*x)*(a + a*sin(c + d*x))^(3/2))/(5*d)]
    @test_int [csc(c + d*x)^1*(a + a*sin(c + d*x))^(5/2), x, 4, -((2*a^(5/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d) - (14*a^3*cos(c + d*x))/(3*d*sqrt(a + a*sin(c + d*x))) - (2*a^2*cos(c + d*x)*sqrt(a + a*sin(c + d*x)))/(3*d)]
    @test_int [csc(c + d*x)^2*(a + a*sin(c + d*x))^(5/2), x, 4, -((5*a^(5/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/d) - (a^3*cos(c + d*x))/(d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*sqrt(a + a*sin(c + d*x)))/d]
    @test_int [csc(c + d*x)^3*(a + a*sin(c + d*x))^(5/2), x, 4, -((19*a^(5/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(4*d)) - (9*a^3*cot(c + d*x))/(4*d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*csc(c + d*x)*sqrt(a + a*sin(c + d*x)))/(2*d)]
    @test_int [csc(c + d*x)^4*(a + a*sin(c + d*x))^(5/2), x, 5, -((25*a^(5/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(8*d)) - (25*a^3*cot(c + d*x))/(8*d*sqrt(a + a*sin(c + d*x))) - (13*a^3*cot(c + d*x)*csc(c + d*x))/(12*d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*csc(c + d*x)^2*sqrt(a + a*sin(c + d*x)))/(3*d)]
    @test_int [csc(c + d*x)^5*(a + a*sin(c + d*x))^(5/2), x, 6, -((163*a^(5/2)*atanh((sqrt(a)*cos(c + d*x))/sqrt(a + a*sin(c + d*x))))/(64*d)) - (163*a^3*cot(c + d*x))/(64*d*sqrt(a + a*sin(c + d*x))) - (163*a^3*cot(c + d*x)*csc(c + d*x))/(96*d*sqrt(a + a*sin(c + d*x))) - (17*a^3*cot(c + d*x)*csc(c + d*x)^2)/(24*d*sqrt(a + a*sin(c + d*x))) - (a^2*cot(c + d*x)*csc(c + d*x)^3*sqrt(a + a*sin(c + d*x)))/(4*d)]


